import React from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      minHeight: "100vh",
      fontFamily: "'Roboto', sans-serif",
      backgroundColor: "#f4f6f9",
      color: "#333",
      margin: 0,
    },
    header: {
      backgroundColor: "#1a73e8",
      color: "#fff",
      padding: "20px 30px",
      textAlign: "center",
      boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    },
    headerTitle: {
      fontSize: "28px",
      fontWeight: "600",
      letterSpacing: "1px",
    },
    main: {
      display: "flex",
      flexDirection: "row",
      flexGrow: 1,
    },
    sidebar: {
      width: "250px",
      backgroundColor: "#2b3e50",
      color: "#ecf0f1",
      padding: "20px",
      boxShadow: "2px 0 8px rgba(0, 0, 0, 0.1)",
    },
    sidebarTitle: {
      fontSize: "22px",
      fontWeight: "600",
      marginBottom: "20px",
      textAlign: "center",
      textTransform: "uppercase",
    },
    sidebarLink: {
      display: "block",
      padding: "10px 15px",
      color: "#ecf0f1",
      textDecoration: "none",
      borderRadius: "5px",
      margin: "8px 0",
      transition: "all 0.3s ease",
    },
    sidebarLinkHover: {
      backgroundColor: "#34495e",
    },
    content: {
      flexGrow: 1,
      padding: "30px",
    },
    cardContainer: {
      display: "grid",
      gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
      gap: "20px",
    },
    card: {
      backgroundColor: "#fff",
      padding: "20px",
      borderRadius: "10px",
      textAlign: "center",
      boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
      border: "1px solid #e3e6ea",
      transition: "transform 0.3s ease, box-shadow 0.3s ease",
    },
    cardHover: {
      transform: "scale(1.05)",
      boxShadow: "0 6px 12px rgba(0, 0, 0, 0.2)",
    },
    cardTitle: {
      fontSize: "18px",
      fontWeight: "600",
      marginBottom: "10px",
    },
    cardLink: {
      display: "inline-block",
      padding: "10px 15px",
      color: "#1a73e8",
      backgroundColor: "#f4f6f9",
      borderRadius: "5px",
      textDecoration: "none",
      fontWeight: "600",
      border: "1px solid #1a73e8",
      transition: "all 0.3s ease",
    },
    cardLinkHover: {
      backgroundColor: "#1a73e8",
      color: "#fff",
    },
  };

  return (
    <div style={styles.container}>
      {/* Header */}
      <header style={styles.header}>
        <h1 style={styles.headerTitle}>Admin Dashboard</h1>
      </header>

      {/* Main Content */}
      <div style={styles.main}>
        {/* Sidebar */}
        <aside style={styles.sidebar}>
          <h2 style={styles.sidebarTitle}>Navigation</h2>
          {[
            { to: "/StudentDetails", label: "Student Details" },
            { to: "/MarkView", label: "Mark View" },
            { to: "/logout", label: "Logout" },
          ].map((link, index) => (
            <Link
              to={link.to}
              key={index}
              style={styles.sidebarLink}
              onMouseEnter={(e) =>
                Object.assign(e.target.style, styles.sidebarLinkHover)
              }
              onMouseLeave={(e) =>
                Object.assign(e.target.style, { backgroundColor: "transparent" })
              }
            >
              {link.label}
            </Link>
          ))}
        </aside>

        {/* Dashboard Cards */}
        <main style={styles.content}>
          <div style={styles.cardContainer}>
            {[
              {
                title: "Student Details",
                description: "View and manage student details.",
                link: "/StudentDetails",
              },
              {
                title: "Mark View",
                description: "Check student marks.",
                link: "/MarkView",
              },
              {
                title: "Logout",
                description: "Logout of the dashboard.",
                link: "/logout",
              },
            ].map((card, index) => (
              <div
                key={index}
                style={styles.card}
                onMouseEnter={(e) =>
                  Object.assign(e.currentTarget.style, styles.cardHover)
                }
                onMouseLeave={(e) =>
                  Object.assign(e.currentTarget.style, {
                    transform: "scale(1)",
                    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
                  })
                }
              >
                <h3 style={styles.cardTitle}>{card.title}</h3>
                <p>{card.description}</p>
                <Link
                  to={card.link}
                  style={styles.cardLink}
                  onMouseEnter={(e) =>
                    Object.assign(e.target.style, styles.cardLinkHover)
                  }
                  onMouseLeave={(e) =>
                    Object.assign(e.target.style, {
                      backgroundColor: "#f4f6f9",
                      color: "#1a73e8",
                    })
                  }
                >
                  Explore &#8594;
                </Link>
              </div>
            ))}
          </div>
        </main>
      </div>
    </div>
  );
};

export default AdminDashboard;
